import React, { Component } from 'react';
import { Row, Col } from 'reactstrap';

class App extends Component {
    render() {
        return (
            <div>
                <Row>
                    <Col>
                        <div>The App</div>
                    </Col>
                </Row>
            </div>
        )
    }
};

export default App;
